import React,{Component} from 'react';
import EmployeeMaster from '../Schema/employee_master';
import Form from 'react-jsonschema-form';

const UiSchema = { }


export default class EmployeePersonalDetails extends Component{
    render() {
        return(
            <div>
                <h1>{this.props.employeeMasterSchema}</h1>
                <Form schema= {this.props.employeeMasterSchema} uiSchema={UiSchema}/>
            </div>
        )
    }
}
